import React from 'react';

function NavBar() {
    return (
        <div className="App">
            <header className="App-header">
                <p>
                   Hello I'm nav bar
                </p>
                <a
                    className="App-link"
                    href="https://reactjs.org"
                    target="_blank"
                    rel="noopener noreferrer"
                >
                    Learn React
                </a>
            </header>
        </div>
    );
}

export default NavBar;
